import { ArrowLeftOutlined, ArrowRightOutlined } from "@material-ui/icons"
import styled from "styled-components"

const Container = styled.div `
  width: 100%;
  height: 100vh;
`;

const Arrow = styled.div`
  width: 50px;
  height: 50px;
  background-color: #DCDCDC;
  border-radius: 50%;
`;


export const Slider = () => {
  return (
    <Container>
      <Arrow>
        <ArrowLeftOutlined/>
      </Arrow>
      <Arrow>
        <ArrowRightOutlined />
      </Arrow>
    </Container>
  )
}
